import React, { Component } from 'react'
const heading = {
    fontSize: '50px',
    color:'red'
}
class InLine extends Component {
    render() {
        return (
            <div>
                <h1 style = {heading}>Kumar shanu</h1>
            </div>
        )
    }
}

export default InLine
